import "./ExpnsesList.css";

import ExpenseItem from "./ExpenseItem";

const ExpensesList = (props) => {
  let expensesContet = <p>No expense found.</p>;

  if (filteredExpenses.lenght > 0) {
    expensesContet = props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));
  }
};

export default ExpenseList;
